import React, { Component } from 'react'

export default class ClassList extends Component {
    
    componentDidMount(){
        this.state = {
            data:['073BCT','073BXE','073BME','073BCX','073BCE']
        }
    }
    render() {
        return (
            <div>
                <h1> Class </h1>
                {this.state.data.map((val, index))}
            </div>
        )
    }
}
